function shortestPolymer(str) {
    let inputArr = str.split(''); // Convert string input to an array
    let checkedLetters = {}; // Checklist of units removed before reacting
    let newArr = []; // Array after removing each letter before reacting
    let shortestLength = str.length; // Length to be stored after reacting
    for(let i of inputArr) {
        let currLetter = i.toLowerCase();
        if(!checkedLetters[currLetter]) { // check against object with letters already tested with
            checkedLetters[currLetter] = 1;
            newArr = inputArr.filter(letter => letter.toLowerCase() !== currLetter);
            let polymerLength = alchemicalReduction(newArr); // React polymers with resulting array
            shortestLength = polymerLength < shortestLength ? polymerLength : shortestLength;
        }
    }
    return shortestLength;
}


function alchemicalReduction(arr) {
    let strArr = arr;
    let length = strArr.length;
    let currentLength = 0;
    while(length !== currentLength) { // Check to see if there has been any change due to polymers reacting
        length = strArr.length; // Update length
        strArr.forEach((unit, index) => {
            if(index === strArr.length - 1) {
                return;
            }
            let nextUnit = strArr[index + 1]; // Unit to compare with
            if(unit.toLowerCase() === nextUnit.toLowerCase()) {
                if(unit !== nextUnit) {
                    strArr.splice(index, 2);
                }
            }
            currentLength = strArr.length;
        });
    }
    return strArr.length;
}

